import React, { useState } from 'react';
import './SellStocks.scss'; // Import SCSS file for styling

const SellStocks = () => {
  const [symbol, setSymbol] = useState('');
  const [quantity, setQuantity] = useState(0);

  const handleSell = () => {
    // Handle sell logic here, e.g., send a request to the backend
  };

  return (
    <div className="sell-stocks-container">
      <h2>Sell Stocks</h2>
      <input type="text" value={symbol} onChange={(e) => setSymbol(e.target.value)} placeholder="Stock Symbol" />
      <input type="number" value={quantity} onChange={(e) => setQuantity(e.target.value)} placeholder="Quantity" />
      <button onClick={handleSell}>Sell</button>
    </div>
  );
};

export default SellStocks;
